using System.Security.Cryptography;
using tracagamesApi.users.models;

namespace tracagamesApi.users.infraestructure.repositoriesMock
{
    internal class GamesCatalogueRepo
    {        
        private List<Game> games;

        internal GamesCatalogueRepo()
        {
           this.games = new List<Game>();
        }
       
        internal List<tracagamesApi.users.application.dtos.Game> cloneToDto() {
            List<tracagamesApi.users.application.dtos.Game> gamesDto = new List<tracagamesApi.users.application.dtos.Game>();
            foreach (Game game in this.games) {
                gamesDto.Add(game.cloneToDto());
            }
            return gamesDto;
        }

        internal List<Game> loadAll()
        {            
            games.Add(new Game("conecta4", "CONECTA 4", "¡El juego Conecta 4 es un clásico juego de estrategia en el que 2 jugadores se enfrentan en un combate cabeza a cabeza por dominar la cuadrícula! Los jugadores eligen discos amarillos o rojos. Dejan caer los discos en la cuadrícula, y comienzan en el centro o en el borde para apilar sus discos de color hacia arriba, en horizontal o en diagonal. ",
     ""));

     games.Add(new Game("rummy", "Rummy", "Rummi es un juego muy entretenido que consiste en formar grupos del mismo número en distintos colores o en escaleras de color hasta quedarte sin fichas. El juego viene presentado en una práctica caja de metal. Los juegos de mesa socializan, ayudan a desarrollar la concentración y a definir estrategias.", ""));

     games.Add(new Game("battleship", "Battle Ship", "La batalla naval (juego de los barquitos o hundir la flota, nombre con el que se comercializó en España el juego de mesa; hundiendo barquitos, en algunos lugares de Hispanoamérica), del nombre en inglés",
     ""));

     games.Add(new Game("soccerbot", "Soccer bot", "Soccer bot", ""));     
                       
            return games;
        }
    }
}
